column8:
人をダメにするビーズクッション！<br>
自分の体型によって形を変えてフィットするキューブソファ登場！<br>
どんな姿勢でもリラックスできます！<br><br><br>●素材<br>
≪スパンデックス生地≫<br>
伸縮する生地：スパンデックス生地（ポリエステル85％、ポリウレタン15％）<br>
伸縮しない生地：側面 綿100％<br>
<br>
中袋：ポリエステル95％、ポリウレタン5％<br>
中材：発泡ポリスチレンビーズ(約0.5mm)<br>
●生産国<br>
日本製(国産)※側生地は中国製です<br>
●サイズ（cm）<br>
約55×約55×約35<br>
●カラー<br>
≪スパンデックス生地≫<br>
ワインレッド・ネイビー・カーキグリーン・ブラウン・ベージュ・ブラック・クリーム・オレンジ・ピンク・ライトグリーン・ライトブルー・マスタード<br>
<br>【シリーズ】<br>
★人をダメにするクッション ビーズチェア M<br>
★人をダメにするクッション ビーズチェア L<br>
★人をダメにするクッション ビーズフロアクッション<br>
